import React, { useState, useEffect, Profiler } from "react";
import Carousel from "react-bootstrap/Carousel";
import Col from "react-bootstrap/Col";
import Card from "react-bootstrap/Card";
import Skeleton from "react-loading-skeleton";
import pdf from "./SaralinZassman_Resume.pdf"
const Leadership = ({ heading, message }) => {
  return (
    <div
      id="leadership"
      className="jumbotron jumbotron-fluid m-0"
      style={{ backgroundColor: "white" }}
    >
      <div className="container container-fluid">
        <h2 className="display-4 pb-5 text-center">{heading}</h2>
        <Col md={6}>
          <Card className="card shadow-lg p-3 mb-5 bg-white rounded">
            <Card.Body>
              <Card.Title as="h5">Hogdfg </Card.Title>
              <Card.Text>Asadfasdass </Card.Text>
              {pdf? <CardButtons pdf={pdf} /> : <Skeleton count={2} />}
              <hr />
            </Card.Body>
          </Card>
        </Col>
      </div>
    </div>
  );
};
const CardButtons = ({ svn_url }) => {
  return (
      <>
        <a href={svn_url} target=" _blank" className="btn btn-outline-secondary">
          <i className="fab fa-github" /> Repo
        </a>
      </>
  );
};

export default Leadership;
